description:
Finally, the best version of The Walking Dead: Assault is available for Android devices.


What's New:

New Release on Android devices for 2.3 and up! Featuring smoother game balance tuning, new in-game item and polish fixes to the overall game.
Game levels have been re-tuned and rebalanced to feel more welcoming to players.
There are new booster items for the player to unlock (extra ammo and medkits).
Improvements to audio and in-game special effects have been made.
Includes Michonne download content from previous release.

